import { all, put, call, takeEvery } from 'redux-saga/effects';

import { actionTypes, getAllQBankSubCategorySuccess, getInactiveQBankSubCategorySuccess } from './action';

import QBankSubCategoryRepository from '../../repositories/QBankSubCategoryRepository';

function* getAllQBankSubCategorySaga({ payload }) {
    try {
        const data = yield call(QBankSubCategoryRepository.getAllQBankSubCategory, payload);
        yield put(getAllQBankSubCategorySuccess(data));
    } catch (err) {
        yield put(getAllQBankSubCategorySuccess(null));
    }
}

function* getInactiveQBankSubCategorySaga({ payload }) {
    try {
        const data = yield call(QBankSubCategoryRepository.getInactiveQBankSubCategory, payload);
        yield put(getInactiveQBankSubCategorySuccess(data));
    } catch (err) {
        yield put(getInactiveQBankSubCategorySuccess(null));
    }
}

export default function* rootSaga() {
    yield all([takeEvery(actionTypes.GET_ALL_QBANK_SUB_CATEGORY_REQUEST, getAllQBankSubCategorySaga)]);
    yield all([takeEvery(actionTypes.GET_INACTIVE_QBANK_SUB_CATEGORY_REQUEST, getInactiveQBankSubCategorySaga)]);
}
